from typing import List
import math

class Solution:
    def minEatingSpeed(self, piles: List[int], h: int) -> int:
        minSpeed = 1
        maxSpeed = max(piles)
        def hoursToFinish(speed):
            return sum([math.ceil(i/speed) for i in piles])
        left, right = minSpeed, maxSpeed
        while left <= right:
            mid = (left + right) // 2
            if hoursToFinish(mid) <= h:
                right = mid - 1
            else:
                left = mid + 1
        return left

